import React from 'react';
import missionIcon from './Foot/mision-icon.png'
import visionIcon from './vision-icon.png';
import valueIcon from './value-icon.png';

function HomePage() {
  const containerStyle = {
    textAlign: 'center',
  };

  const imageStyle = {
    width: '100%',
    maxHeight: '500px',
  };

  const sectionContainerStyle = {
    display: 'flex',
    justifyContent: 'space-around',
    margin: '20px',
  };

  const sectionStyle = {
    flex: '1',
    margin: '20px',
  };

  const iconStyle = {
    width: '100px',
    height: '100px',
    marginBottom: '10px',
  };

  const titleStyle = {
    fontWeight: 'bold',
    fontSize: '20px',
  };

  const descriptionStyle = {
    textAlign: 'center',
  };

  return (
    <div style={containerStyle}>
      <img src="https://api.time.com/wp-content/uploads/2020/10/luca-locatelli-copenhill-copenhagen-bjarke-ingels.jpg?quality=85&w=2400" alt="Building Image" style={imageStyle} />

      <div style={sectionContainerStyle}>
        <div style={sectionStyle}>
          <img src={missionIcon} alt="Mission Icon" style={iconStyle} />
          <h3 style={titleStyle}>Our Mission</h3>
          <p style={descriptionStyle}>
            To provide technically excellent and innovative solutions
            in urban planning, environment, development research,
            and geo design.
          </p>
        </div>

        <div style={sectionStyle}>
          <img src={visionIcon} alt="Vision Icon" style={iconStyle} />
          <h3 style={titleStyle}>Our Vision</h3>
          <p style={descriptionStyle}>
            To be a leading hub in urban planning, geo solutions,
            environment, and development research.
          </p>
        </div>
      </div>

      <div style={sectionContainerStyle}>
        <div style={sectionStyle}>
          <img src={valueIcon} alt="Value Icon" style={iconStyle} />
          <h3 style={titleStyle}>Core Values</h3>
          <ul style={descriptionStyle}>
            <li>Honesty & Integrity</li>
            <li>Professionalism</li>
            <li>Client Satisfaction</li>
            <li>Prompt Service Delivery</li>
            <li>Technical Excellence</li>
            <li>Social Responsibility</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
